import { useRef } from "react";
import { useState } from "react";
import "./register.scss";
import axios from "axios";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";

export default function Register() {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [firstName, setFirstName] = useState("");
  const [lastName, setLastName] = useState("");
  const [username, setUsername] = useState("");
  const [gender, setGender] = useState("");

  const emailRef = useRef();
  const passwordRef = useRef();
  const firstNameRef = useRef();
  const lastNameRef = useRef();
  const usernameRef = useRef();
  const genderRef = useRef();

  const handleStart = () => {
    setEmail(emailRef.current.value);
  };

  const handleFinish = async (event) => {
    event.preventDefault();
    const newUser = {
      email: email,
      password: passwordRef.current.value,
      firstname: firstNameRef.current.value,
      lastname: lastNameRef.current.value,
      username: usernameRef.current.value,
      gender: genderRef.current.value,
    };

    try {
      const response = await axios.post("http://localhost:8000/user", newUser);
      console.log(response.data);
      // Handle success or do something with the response data
    } catch (error) {
      console.log(error.response.data);
      // Handle error or display error message
    }

    setPassword(passwordRef.current.value);
  };

  return (
    <div className="register">
      <div className="top">
        <div className="wrapper">
          <img
            className="logo"
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Netflix_2015_logo.svg/2560px-Netflix_2015_logo.svg.png"
            alt=""
          />
          <button className="loginButton">Sign In</button>
        </div>
      </div>
      <div className="container">
        <h1>Unlimited movies, TV shows, and more.</h1>
        <h2>Watch anywhere. Cancel anytime.</h2>
        <p>
          Ready to watch? Enter your email to create or restart your membership.
        </p>
        {!email ? (
          <div className="input">
            <input type="email" placeholder="email address" ref={emailRef} />
            <button className="registerButton" onClick={handleStart}>
              Get Started
            </button>
          </div>
        ) : (
          <form className="input otherDetails">
            <TextField
              type="text"
              label="First Name"
              placeholder="First Name"
              inputRef={firstNameRef}
            />
            <TextField
              type="text"
              label="Last Name"
              placeholder="Last Name"
              inputRef={lastNameRef}
            />
            <TextField
              type="text"
              label="Username"
              placeholder="Username"
              inputRef={usernameRef}
            />
            <TextField
              type="password"
              label="Password"
              placeholder="Password"
              inputRef={passwordRef}
            />
            <Select label="Gender" defaultValue="" inputRef={genderRef}>
              <MenuItem value="">Select Gender</MenuItem>
              <MenuItem value="male">Male</MenuItem>
              <MenuItem value="female">Female</MenuItem>
              <MenuItem value="other">Other</MenuItem>
            </Select>
            <Button
              variant="contained"
              color="primary"
              className="registerButton"
              onClick={handleFinish}
            >
              Start
            </Button>
          </form>
        )}
      </div>
    </div>
  );
}
